  return (
    <div className='home'>
      <Container>
      <Grid container spacing={2} sx={{display:'flex',flexWrap:'wrap'}}>
        <Grid item xs={6}>
          <Typography variant='h6' component='div' color='primary'>Welcome To</Typography>
        </Grid>
